"use strict";(self.webpackChunkchachagogogo_github_io=self.webpackChunkchachagogogo_github_io||[]).push([[477],{10:function(u){u.exports=JSON.parse('{"blogPosts":[{"id":"opening-docusaurus-blog","metadata":{"permalink":"/blog/opening-docusaurus-blog","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-01-Docusaurus \ube14\ub85c\uadf8\ub97c \uc2dc\uc791\ud569\ub2c8\ub2e4.md","source":"@site/blog/2022-06-01-Docusaurus \ube14\ub85c\uadf8\ub97c \uc2dc\uc791\ud569\ub2c8\ub2e4.md","title":"Docusaurus \ube14\ub85c\uadf8\ub97c \uc2dc\uc791\ud569\ub2c8\ub2e4","description":"\uc624\ub7ab\ub3d9\uc548 \'\uac1c\ubc1c \uc0ac\uc774\ud2b8\ub97c \uc9c4\uc9c0\ud558\uac8c \uc6b4\uc601\ud574\uc57c\uaca0\ub2e4\'\ub294 \uc0dd\uac01\uc744 \ud588\uc2b5\ub2c8\ub2e4.","date":"2022-06-01T00:00:00.000Z","formattedDate":"2022\ub144 6\uc6d4 1\uc77c","tags":[{"label":"blog","permalink":"/blog/tags/blog"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":2.67,"truncated":false,"authors":[{"name":"\ud574\uc2b9","title":"\ub808\ubca8 1 \uac1c\ubc1c\uc790","url":"https://twitter.com/haeseung_dev","imageURL":"https://avatars.githubusercontent.com/u/73287554?v=4","key":"\ud574\uc2b9"}],"frontMatter":{"slug":"opening-docusaurus-blog","authors":"\ud574\uc2b9","tags":["blog","docusaurus"]}},"content":"\uc624\ub7ab\ub3d9\uc548 \'\uac1c\ubc1c \uc0ac\uc774\ud2b8\ub97c \uc9c4\uc9c0\ud558\uac8c \uc6b4\uc601\ud574\uc57c\uaca0\ub2e4\'\ub294 \uc0dd\uac01\uc744 \ud588\uc2b5\ub2c8\ub2e4.  \\n\uba87 \uac00\uc9c0 \uc774\uc720\uac00 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc6b0\uc120, **\uc624\ub298 \ud55c \uacf5\ubd80\ub97c \uae30\ub85d\ud558\uc9c0 \uc54a\uc73c\uba74 \ub0b4\uc77c \uc78a\uc5b4\ubc84\ub9ac\uae30 \ub54c\ubb38**\uc785\ub2c8\ub2e4.  \\n\uac1c\ubc1c\uc790\ub294 \ubc29\ub300\ud55c \uc9c0\uc2dd\uc744 \uc774\ud574\ud558\uace0 \uc678\uc6cc\uc57c \ud558\ub294 \uc9c1\uc5c5\uc785\ub2c8\ub2e4.\\n\ud544\uc694 \uc554\uae30\ub7c9\uc774 \uc6cc\ub099 \ub9ce\uc544\uc11c \uae08\uc138 \uc78a\uae30 \uc77c\uc464\uc785\ub2c8\ub2e4.\\n\uadf8\ub798\uc11c \uae30\ub85d\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\\n\uc775\ud78c \uac1c\ub150\uc744 \uae00\ub85c \uc815\ub9ac\ud558\uace0, \uc608\uc81c \ucf54\ub4dc\ub97c \ub0a8\uaca8 \ub193\uc73c\uba74 \uc5b8\uc820\uac00\ub294 \ubc18\ub4dc\uc2dc \uacfc\uac70\uc758 \ub098\uc5d0\uac8c \uace0\ub9c8\uc6cc \ud560 \uc77c\uc774 \uc0dd\uae41\ub2c8\ub2e4.\\n\ud558\ub2e4 \ubabb\ud574 \uc2a4\ud0dd\uc624\ubc84\ud50c\ub85c\uc6b0 \ub9c1\ud06c\ub77c\ub3c4 \ub0a8\uaca8\ub194\uc57c \ud569\ub2c8\ub2e4.\\nDocusaurus\ub294 \ub178\ud2b8\uc640 \ube14\ub85c\uadf8\uac00 \ubd84\ub9ac\ub418\uc5b4 \uc788\uc5b4\uc11c, \uadf8\ub9ac\uace0 \ub9c8\ud06c\ub2e4\uc6b4\uc744 \uc9c0\uc6d0\ud558\uae30 \ub54c\ubb38\uc5d0 \uc120\ud0dd\ud588\uc2b5\ub2c8\ub2e4.\\n\\n\\n\ub450\ubc88\uc9f8 **\uc9c0\uc2dd\uc744 \uacf5\uc720\ud558\uae30 \uc704\ud574\uc11c**\uc785\ub2c8\ub2e4.  \\n\uc778\ud130\ub137\uc5d0\uc11c \ub9ce\uc740 \uac1c\ubc1c \uc9c0\uc2dd\uc744 \ubc30\uc6e0\uc2b5\ub2c8\ub2e4.\\n\uadf8\uac83\ub3c4 \ubb34\ub8cc\ub85c \ub9d0\uc774\uc8e0.\\n\uc81c\uac00 \ubb34\ub8cc\ub85c \uc5bb\uc5c8\uc73c\ub2c8 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc5d0\uac8c\ub3c4 \ubb34\ub8cc\ub85c \ub3cc\ub824\uc918\uc57c \ud569\ub2c8\ub2e4.\\n\\n\uc138\ubc88\uc9f8 **\ucee4\ub9ac\uc5b4\ub97c \uc704\ud574\uc11c**\uc785\ub2c8\ub2e4.  \\n\uac1c\ubc1c\uc790\ub294 \ub2e4\ub978 \uc9c1\uc5c5\uc5d0 \ube44\ud574 \uc720\ub09c\ud788 \uc2e4\ub825\uc744 \uac1d\uad00\uc801\uc73c\ub85c \ubcf4\uc5ec\uc8fc\uae30 \uc5b4\ub824\uc6b4 \uc9c1\uc5c5\uc785\ub2c8\ub2e4.\\n\uc790\uaca9\uc99d\uc774 \ub9ce\uc73c\uba74 \uc88b\uc740 \uac1c\ubc1c\uc790\uc77c\uae4c\uc694?\\n\uc88b\uc740 \ud559\uad50\ub97c \ub098\uc624\uba74 \uc88b\uc740 \uac1c\ubc1c\uc790\uc77c\uae4c\uc694?\\n\ub0b4\uac00 \'\ubb34\uc5c7\uc744, \uc5bc\ub9c8\ub098\' \uc720\ub2a5\ud558\uac8c \ud560 \uc218 \uc788\ub294\uc9c0 \uc5b4\ub5bb\uac8c \ub9d0\ud560 \uc218 \uc788\uc744\uae4c\uc694?\\n\uc0c1\ub2f9\ud788 \uc5b4\ub835\uc2b5\ub2c8\ub2e4.  \\n\ub610\ud55c \uac1c\ubc1c\uc790\ub294 \ub04a\uc784\uc5c6\uc774 \uc790\uc2e0\uc744 \ud64d\ubcf4\ud574\uc57c \ud558\ub294 \uc9c1\uc5c5\uc785\ub2c8\ub2e4.\\n\uc544\ubb34\ub9ac \ub0b4\uac00 \uac1c\ubc1c\uc744 \uc798\ud55c\ub4e4 \ub0a8\ub4e4\uc774 \uc54c\uc544\uc8fc\uc9c0 \uc54a\uc73c\uba74 \uc778\uc815\ubc1b\uc9c0 \ubabb\ud569\ub2c8\ub2e4.\\n\uad6c\uc2ac\uc774 \uc11c \ub9d0\uc774\uc5b4\ub3c4 \uaff0\uc5b4\uc57c \ubcf4\ubc30\uc785\ub2c8\ub2e4.\\n\uacb0\uad6d \ud64d\ubcf4\ub3c4 \uc2e4\ub825\uc785\ub2c8\ub2e4.\\n\uac1c\ubc1c \ube14\ub85c\uadf8\ub97c \ud1b5\ud574 \'\ub098\'\ub77c\ub294 \uac1c\ubc1c\uc790\ub97c \uc870\uae08\uc774\ub77c\ub3c4 \uc54c\ub9ac\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc774\uc81c\ubd80\ud130 \ube14\ub85c\uadf8 \uc5ec\uc815\uc744 \uc2dc\uc791\ud574\ubcf4\ub3c4\ub85d \ud558\uaca0\uc2b5\ub2c8\ub2e4."}]}')}}]);